import org.apache.iceberg.io.CloseableIterable;
public class FindFiles {
  private static final DateTimeFormatter DATE_FORMAT = DateTimeFormatter.ofPattern("yyyy-MM-dd HH:mm:ss.SSS");
  public static Builder in(Table table) {
    return new Builder(table);
  }

  public static class Builder {
    private final Table table;
    private String fromSnapshotId = null;
    private String toSnapshotId = null;
    private boolean ascending = true;

    private Builder(Table table) {
      this.table = table;
    }

    public Builder fromSnapshotId(String snapshotId) {
      this.fromSnapshotId = snapshotId;
      return this;
    }

    public Builder toSnapshotId(String snapshotId) {
      this.toSnapshotId = snapshotId;
      return this;
    }

    public Builder ascending(boolean ascending) {
      this.ascending = ascending;
      return this;
    }

    public CloseableIterable<File> find() {
      if (fromSnapshotId == null && toSnapshotId == null) {
        throw new IllegalArgumentException("Either fromSnapshotId or toSnapshotId must be specified");
      }

      List<String> snapshotIds = new ArrayList<>();
      if (fromSnapshotId != null) {
        snapshotIds.add(fromSnapshotId);
      }
      if (toSnapshotId != null) {
        snapshotIds.add(toSnapshotId);
      }

      return table.newScan()
          .useSnapshot(snapshotIds)
          .select("*")
          .orderBy("commit_time", ascending ? SortDirection.ASC : SortDirection.DESC)
          .build()
          .planFiles();
    }
  }
}

