/**
 * Returns an array of URL parameters that can be forwarded
 *
 * @param LSRequest $request
 * @return array<string,mixed>
 */
function getForwardParameters($request)
{
    // Get the list of allowed parameters from the configuration file
    $allowedParams = config('forward_params');

    // Initialize an empty array to store the forwarded parameters
    $forwardParams = [];

    // Iterate over each parameter in the request
    foreach ($request->getParameters() as $param => $value) {
        // Check if the parameter is allowed and not null
        if (in_array($param, $allowedParams) && !is_null($value)) {
            // Add the parameter to the list of forwarded parameters
            $forwardParams[$param] = $value;
        }
    }

    return $forwardParams;
}

