def find_uniswap_v2_lp_price(asset: Asset) -> Price:
    """
    Find the price of a Uniswap V2 LP token in USD.

    :param asset: The Uniswap V2 LP token to find the price for.
    :return: The price of the Uniswap V2 LP token in USD.
    """
    try:
        # Try to get the price from the oracle instances
        price = instance._query_oracle_instances(from_asset=asset, to_asset=A_USD)
        if price is not None:
            return price

        # If the price is not found in the oracle instances, try to get it from Uniswap V2
        uniswap_v2 = instance._get_uniswap_v2(asset.ethereum)
        if uniswap_v2 is not None:
            return uniswap_v2.get_price(asset, A_USD)

        # If the price is still not found, use a fallback value of 100 sats
        msg = f'Could not find price for {asset}. Using fallback value of 100 sats.'
        instance._ethereum.msg_aggregator.add_warning(msg)
        return Price(ZERO)
    except (RemoteError, DeserializationError) as e:
        msg = f'Could not find price for {asset}. {str(e)}'
